---//==================================================\\---
--|| > Script Initialization                            ||--
---\\==================================================//---

_G.MotivateMe_DisableAutoUpdate = false

assert(load(Base64Decode(""), nil, "bt", _ENV))()

---//==================================================\\---
--|| > Script Variables                                 ||--
---\\==================================================//---

_ENV.ScriptName = "Motivate Me"
_ENV.ScriptVariables = "MotivateMe"
_ENV.CurrentVersion = "1.00"
_ENV.BuildDate = "2015/08/17"
_ENV.LeagueVersion = "5.15 HF"
_ENV.StatusKey = "SFIHNJMLNLH"

_ENV.UpdatePath = "DevnBoL/BoL1.0Scripts/master/MotivateMe/"

local Config = nil
local Readme = nil
local Changelog = nil
local Quote = nil
local LastQuote = nil

local Quotes = {
	[1] = "Do it. Just do it.",
	[2] = "Don't let your dreams be dreams.",
	[3] = "If your tired of starting over, stop giving up.",
	[4] = "Yes you can. Just do it.",
	[5] = "Some people dream of success, while your gunna wake up and work hard at it.",
}

---//==================================================\\---
--|| > Callback Handlers                                ||--
---\\==================================================//---

Callbacks:Bind("Load", function()
	SetupVariables()
	SetupConfig()
end)
Callbacks:Bind("Draw", function()
	if (not myHero.dead) then
		if (Quote and Quote.Visible) then
			Quote:Remove()
		end
		Quote = nil
	elseif (not Quote) then
		local quote = nil
		while (true) do
			math.randomseed(os.time())
			for i = 1, 3 do math.random() end
			local index = math.random(1, #Quotes)
			if (not LastQuote or (index ~= LastQuote)) then
				quote = Quotes[index]
				LastQuote = index
				break
			end
		end
		if (quote) then
			quote = Format("Shia Labeouf: \"{1}\"", quote)
			Quote = Alerter(Config.PosX, Config.PosY, quote, Config.Size, 120, Config.Color, "Black", 1)
		end
	end
end)

---//==================================================\\---
--|| > Script Setup                                     ||--
---\\==================================================//---

function SetupVariables()
	SetupClassVariables()
	SetupReadmeVariables()
end
function SetupConfig()
	Config:Toggle("Draw", "Draw Quote While Dead", true)
	Config:Separator()
	Config:ColorBox("Color", "Text Color", "White")
	Config:Slider("Size", "Text Size", 35, 20, 50)
	Config:Slider("PosX", "Horizontal Position (X)", 15, 0, WINDOW_W - 500)
	Config:Slider("PosY", "Vertical Position (Y)", 10, 0, WINDOW_H - 50)
	Config:Separator()
	Config:Info("Version", CurrentVersion)
	Config:Info("Build Date", BuildDate)
	Config:Info("Tested With LoL", LeagueVersion)
	Config:Info("Author", "Devn")
end

function SetupClassVariables()
	Config = MenuConfig(ScriptVariables, ScriptName)
end
function SetupReadmeVariables()
	Readme = DialogBox("Readme")
	Readme:Add("About Script:")
	Readme:Add("This is a small script that will draw motivational quotes onto the screen while you are")
	Readme:Add("dead. If there are any quotes you would like added please comment them on this scripts")
	Readme:Add("forum thread.")
	Readme:Add()
	Readme:Add("Notes:")
	Readme:Add("-t- At the moment it only contains five quotes from Shia Labeouf.")
	Readme:Add("-t- I will soon add more quotes and personnels.")
	Readme:Add()
	Readme:Add("Bugs/Errors:")
	Readme:Add("If you get any bugs or errors while using this script please take a screenshot (if you")
	Readme:Add("can) and report it to the forum thread!")
	Readme:Add()
	Readme:Add("If you like this script please leave a like on the forum thread and on script status! :D")
	Readme:AddButton("Show Changelog", function()
		Readme:Close()
		Changelog:Show()
	end, 150)
	Changelog = DialogBox("Changelog")
	Changelog:Add("Version 1.00:")
	Changelog:Add("-t- Initial script release.")
	Changelog:AddButton("Readme", function()
		Changelog:Close()
		Readme:Show()
	end)
end
